import avatar from '../ava.jpg'
const our_chats = [
    {
        name:'Name',
        image_path:'',
    },
    {}

]
export function Chat (){
    return(
    <>
        {our_chats.map(item => {
        return(
            <div class="chat">
            <img src={avatar} alt=""/>
            <span class="chat_name">{item.name}</span>
        </div>);
        })}
    </>
    )
}
